import { Button, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, TextField } from '@mui/material';
import React, { useState } from 'react';
import '../App.css';
// import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import { useNavigate } from 'react-router-dom';
const UserList = () => {

    const navigate = useNavigate();

    // Estado para armazenar a lista de usuários
    const [users, setUsers] = useState([{ id: 1, name: "Daney Campos", cpf_cnpj: "021.211.523-50", phone: "(85) 9.9931-5636", email: "daneycordeiro@gmail.com", businessAddresses: 'Rua Belo Horizonte, 2930/ Rua José Cavalcante Sobrinho, 120', residentialAddresses: 'Rua Belo Horizonte, 2930/ Rua José Cavalcante Sobrinho, 120' }, { id: 1, name: "Daney Campos", cpf_cnpj: "021.211.523-50", phone: "(85) 9.9931-5636", email: "daneycordeiro@gmail.com", businessAddresses: 'Rua Belo Horizonte, 2930/ Rua José Cavalcante Sobrinho, 120', residentialAddresses: 'Rua Belo Horizonte, 2930/ Rua José Cavalcante Sobrinho, 120' }]);
    // Estado para armazenar o valor do input de pesquisa
    const [searchValue, setSearchValue] = useState('');
    const [open, setOpen] = React.useState(false);

    // Função para adicionar um novo usuário (será chamada pelo botão "Criar Novo Usuário")
    const handleAddUser = () => {
        // Implemente aqui a lógica para adicionar um novo usuário à lista de usuários
        // Por exemplo, exibir um modal ou redirecionar para outra página com o formulário de cadastro
        console.log('Adicionar novo usuário');
        navigate("/userDetails");
    };

    // Função para pesquisar usuários (será chamada pelo botão "Pesquisar")
    const handleSearch = () => {
        // Implemente aqui a lógica para filtrar a lista de usuários com base no valor de pesquisa
        // e atualizar o estado 'users' com os resultados da pesquisa
        console.log('Pesquisar usuários com o valor:', searchValue);
    };



    const handleClickOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };

    return (
        <div className="App">
            <div className="search-and-create">
                <div className="search">
                    <TextField
                        fullWidth={true}
                        size='small'
                        label="Pesquisar por Nome"
                        value={searchValue}
                        onChange={(e) => setSearchValue(e.target.value)}
                    />
                </div>
                <div className='btn-search'>
                    <Button variant="contained" onClick={handleSearch}>Pesquisar</Button>
                </div>
                <div className='btn-new-user'>
                    <Button variant="contained" onClick={handleAddUser}>Novo Usuário</Button>
                </div>
            </div>
            <h2 className='title-page'> Usuários </h2>
            <TableContainer component={Paper}>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>Nome</TableCell>
                            <TableCell>CPF/CNPJ</TableCell>
                            <TableCell>Telefone</TableCell>
                            <TableCell>Email</TableCell>
                            <TableCell>Endereços Comerciais</TableCell>
                            <TableCell>Endereços Residenciais</TableCell>
                            <TableCell>Ações</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {users.map((user) => (
                            <TableRow key={user.id}>
                                <TableCell>{user.name}</TableCell>
                                <TableCell>{user.cpf_cnpj}</TableCell>
                                <TableCell>{user.phone}</TableCell>
                                <TableCell>{user.email}</TableCell>
                                <TableCell className='address'>{user.businessAddresses}</TableCell>
                                <TableCell className='address'>{user.residentialAddresses}</TableCell>
                                <TableCell className='buttons'>
                                    <Button variant="contained" color="primary">Editar</Button>
                                    <Button className='btn-remove' variant="contained" onClick={handleClickOpen} color="error">Excluir</Button>
                                </TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>

            <Dialog
                open={open}
                onClose={handleClose}
                aria-labelledby="alert-dialog-title"
                aria-describedby="alert-dialog-description"
            >
                <DialogTitle id="alert-dialog-title">
                    {"Deseja realmente excluir este usuário?"}
                </DialogTitle>
                <DialogContent>
                    <DialogContentText id="alert-dialog-description">
                        Esta ação é irreversível
                    </DialogContentText>
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClose}>Não</Button>
                    <Button onClick={handleClose} autoFocus> Sim </Button>
                </DialogActions>
            </Dialog>
        </div>
    );
};

export default UserList;
